■メーカー:ＤＨＣ<br>■賞味期限:（メーカー製造日より）10カ月<br>■吸収力にすぐれたコラーゲンペプチドを3,000mg配合（1包あたり）したゼリータイプのサプリメントです。サポート成分として、ヒアルロン酸15mg、エラスチン5mg、セラミド100μg、マンゴスチンエキス末10mgも配合しました。食べやすく、持ち運びにも便利なスティックタイプなので、学校やオフィスでのおやつにもぴったり。マンゴーピューレを使用した果汁感溢れる濃厚な味わいで、冷やすとよりいっそうおいしくいただけます。砂糖不使用で1包あたりたったの14kcalなので、カロリーが気になる方でも安心です。美容成分を贅沢に配合したおいしいゼリーで、キレイづくりをパワフルに応援します。<br>1日1包を目安にお召し上がりください。<!--▼おすすめ商品（目玉商品機能）タイトル画像-->
